INSERT INTO `products` VALUES (1,'Botella Térmica UTEZ','Botella Térmica de Acero Inoxidable Termo de Café o Té con Aislamiento para Frío Botella Térmica 900ml','<div><b></b><h1><b>Acerca de este producto</b></h1></div><div><b><br></b></div><div><b>Capacidad:</b><span style=\"white-space:pre\">	</span>900 Mililitros</div><div><b>Dimensiones del producto:</b><span style=\"white-space:pre\">	</span>8.5 x 24.5 centímetros</div><div><b>Peso del producto:</b><span style=\"white-space:pre\">	</span>431 Gramos</div><div><b>Material:</b><span style=\"white-space:pre\">	</span>Acero inoxidable</div><div><i><br></i></div><div><i><br></i></div><div><span style=\"font-size: 1rem; text-align: var(--bs-body-text-align);\"><i>A PRUEBA DE FUGAS:</i> Adopta acero inoxidable de doble capa avanzada, creado de boca de botella estrecha, cada tapa de botella con anillo de silicona de grado alimenticio para garantizar que no haya fugas de agua, beba en el auto / tren / barco No se preocupe sobre la salida del agua.</span></div><div><i>BOTELLA DE AGUA DE ACERO INOXIDABLE</i>: Botella de acero inoxidable de doble pared, que puede mantener el agua caliente durante 12 horas y la bebida fresca durante hasta 12 horas. Incluso si la botella de agua se encuentra llena de agua helada, no va a tirar gotas de agua en la botella.</div><div><i>SEGURO Y SALUDABLE:</i> La botella de vacío de alto rendimiento de 900 ml hecha de acero inoxidable de grado alimenticio de grado 304. Resistente, resistente al desgaste, seguro y saludable. Certificado por la FDA para satisfacer las necesidades de consumo. Por supuesto, el cien por ciento no contiene BPA nitratos.</div><div><div style=\"text-align:center;\"><img src=\"https://http2.mlstatic.com/D_NQ_NP_613903-MLM31999715711_082019-O.jpg\"></div><br></div><div><br></div>','Simple',1,_binary '\\\0JFIF\0\0`\0`\0\0\\0C\0\n\n\n\r\r\\0C		\r\r\0